import React from "react"
import ReactDOM from "react-dom"
import Home, { Following } from "./Home"
//import "./Home.css"

const App = () => {
    return (
        <>
        <Home name="Home" />
        <Following name="Following" />
        </>
    )
}

const rootElement = document.getElementById("root")
ReactDOM.render(<App />, rootElement)
